    /**
     * Spits out the Java code needed to draw the tiger. Just feed it the Tiger.svg file,
     * copy the output and replace the code in the constructor with the output.
     *
     * @param args
     * @throws Exception
     */
    public static void main(String[] args) throws Exception {
        File file = new File(Tiger.class.getResource("Tiger.svg").toURI());
        DocumentBuilderFactory factory = DocumentBuilderFactory.newInstance();
        Document dom = factory.newDocumentBuilder().parse(file);

        XPath xpath = XPathFactory.newInstance().newXPath();
        XPathExpression findAll = xpath.compile("/svg/g/g");
        NodeList nodes = (NodeList) findAll.evaluate(dom, XPathConstants.NODESET);

        for (int i=0; i<nodes.getLength(); i++) {
            Element g = (Element) nodes.item(i);
            String id = g.getAttribute("id");
            Double strokeWidth = g.hasAttribute("stroke-width") ? Double.valueOf(g.getAttribute("stroke-width")) : null;
            String stroke = g.hasAttribute("stroke") ? g.getAttribute("stroke") : null;
            String fill = g.hasAttribute("fill") ? g.getAttribute("fill") : null;

            Element SVGPath = (Element) g.getElementsByTagName("SVGPath").item(0);
            String pathString = SVGPath.getAttribute("d");

            String object = "p" + id;
            System.out.println("SVGPath " + object + " = new SVGPath();");
            if (strokeWidth != null) {
                System.out.println(object + ".setStrokeWidth(" + strokeWidth + ");");
            }
            if (stroke != null) {
                System.out.println(object + ".setStroke(Color.web(\"" + stroke + "\"));");
            }
            if (fill != null) {
                if (fill.equals("#000")) fill = "Color.BLACK";
                else if (fill.equals("#FFF")) fill = "Color.WHITE";
                else fill = "Color.web(\"" + fill + "\")";
                System.out.println(object + ".setFill(" + fill + ");");
            }
            System.out.println(object + ".setContent(\"" + pathString + "\");");
            System.out.println("getChildren().add(" + object + ");");

            // m, L, c, z, h, v, s, q, t, a ...?
        }


    }
